import styled from "styled-components";


export default function Cart() {
    return(
        <Page>
        <Top>
            <TopLeft>
                <ion-icon name="chevron-back-outline"></ion-icon>
            </TopLeft>
            <TopRigth>
                <span>Endere√ßo</span>
                <div>
                    <ion-icon name="location-outline"></ion-icon>
                </div>
            </TopRigth>
        </Top>
        <span>My Cart</span>
        </Page>
        );
}
const Page = styled.div`
    width: 100%;
    min-height: 100vh;
    height: 100%;
    background-color: #FFFFFF;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
`;
const Top = styled.div`
    width: 100%;
    padding: 0px 30px;
    margin: 40px 0px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`;

const TopLeft = styled.div`
    width: 37px;
    height: 37px;
    background-color: #010035;
    border-radius: 10px;
    display: flex;
    align-items: center;
    justify-content: center;
    ion-icon {
        font-size: 28px;
        color: #FFFFFF;
    }
`;

const TopRigth = styled.div`
    display: flex;
    align-items: center;
    span {
        color: #010035;
        font-family: 'Mark Pro', sans-serif;
        font-size: 15px;
        font-weight: bold;
        margin-right: 10px;
    }
    div {
        width: 37px;
        height: 37px;
        background-color: #FF6E4E;
        border-radius: 10px;
        display: flex;
        align-items: center;
        justify-content: center;
    }
    ion-icon {
        color: #FFFFFF;
        font-size: 20px;
    }
`;
